webpackJsonp([16,200],{641:function(n,e){n.exports={rawContent:"\n> 随波逐浪到天涯，  \n> 迁客西还有几家。  \n> 却到帝都重富贵，  \n> 请君莫忘浪淘沙。\n> \n> –白居易\n> \n> 所以，人啊，就都不知道，自己就不可以预料。\n> \n> – 长者\n\n三年前从无锡来到北京，我不知道家人如何想，别人如何看，我知道我怎么想。\n\n所谓不在乎，不在乎北邮要不要我，我能不能有机会来上学。\n\n所谓在乎者，两年半永不忘怀的日日夜夜，两年来有缘相见并肩前行擦肩而过的，  \n最可爱到人们。\n\n所谓无力者，停不住时间，留不住人心，挡不住生老病死，日远日疏。\n\n所谓坚韧者，任性而为，敢做敢当，无畏无惧，无怨无悔。\n\n所谓幸运者，最美好到时光中遇到最善良可爱到人们，就算时光在他人眼里形同土芥，  \n于我如璀璨明珠，光耀一生。\n\n所谓悲哀者，往事终将远去，烟消云散。\n\n回顾下难忘的吧\n\n## 北邮游泳馆\n\n再见，这片碧水和缘起碧水的朋友们。\n\n如果工作没很忙，我还会回来吧。\n\n这两年，最快乐到时光在那里，最难过到时候会去那里。\n\n我在那里寻找自我，在那里思悟人生，\n\n在那里嬉笑怒骂，在那里感受到激昂的人生力量，\n\n这片碧水是我的热情、热爱、\n\n是我的哲学，我的生活，我的坚守，我的寄托和期望，\n\n是我的世界。\n\n是我\n\n虽心有万千，能言之者几？都云作者痴，谁解其中味。\n\n## 新科研楼1110\n\n3月，毕业顺利的我手足无措。\n\n两年半，实验室自始至终善待了我。\n\n我幼稚的时候，\n\n我任性的时候，\n\n我生病的时候，\n\n我黑它的时候。\n\n该怎么说感谢呢？\n\n果有言邪？其未尝有言邪？\n\n往事历历在目，师姐、师兄、同学、师弟、师妹、同事。\n\n我何德何能，忝列其间。\n\n时光若能倒转，我愿回到那里，\n\n拿起小本去楼下超市继续给大家拿酸奶\n\n叹叹！！\n\n## 小白楼302\n\n跟老师学习待人接物，\n\n长了一年的知识。\n\n## Google Camp\n\n理想学生社团形态哈哈哈。自由第一，学生为重。\n\n组队刷GDG devfest，Ingress社团，组队轻松学安卓，教室幻灯放电影，  \n学活烧菜煮排骨，参观谷歌中国，招新忽悠扯淡，茶话会，未遂的忽悠红帽中国赞助，  \n挂名linux user group，大概就是这样吧。\n\n## 北邮滑雪群\n\n最后滑了一波雪，遇见了一群小伙伴。\n\n## 最后\n\n22:49，教三马上要关门了。\n\n我想说最后的话，如果没什么意外，工作就确定了。\n\n明天就要去长亭科技，额，上班。\n\n我总觉得，我这种渣渣。。都被收进去了，压力好大。\n\n努力学习进步，但求做一个有用的人。\n\n感谢从实习开始一路帮助我记住我的人，\n\n你们给了我坚定的信念去相信无限可能的未来。\n\n而信念就是力量。\n\n感谢收留我的ztrix的信任，\n\n希望我不会食言。\n",metaData:{layout:"post",title:"Yet Another New Journey",excerpt:"入职长亭",category:"life",tags:["life"],disqus:!0}}}});